let todo = [
    'element 1',
    'element 2',
    'element 3',
    'element 4',
];

const suppr = (el) => {
    todo.splice(el, 1);
};

const TodoList = _=>{
    return (
        <div>
            <ul>
                {todo.map((todoElement, index) => (
                    <li key={todoElement}>
                        {todoElement} {index} 
                        
                        <button onClick={()=>suppr(index)}> supprimer</button>
                    </li>
                ))}
            </ul>
        </div>
    );
}
export default TodoList
